import React from 'react';
import DefaultLayout from '../layouts/DefaultLayout.jsx';
import './_app.jsx';
import cat from '../backup.public/images/cat.jpg';

const Home = () => {
    return (
        <DefaultLayout>
            <h2>
                Welcome to Mlo Art where you can buy a unique art. 
                <br/>
                No art piece is alike.
            <img src= "cat" alt= "cat.jpg"/>
            </h2>
        </DefaultLayout>
    );
};

export default Home;
